import "../styles/Home.css";

const Home = () => {
  return (
    <div className="container-fluid">
      <div className="container d-flex flex-row align-items-center">
        <div className="home-text p-10">
          <h1 className="display-1">Pablo Asenjo</h1>
          <h3 className="display-3">Desarrollador Full-Stack</h3>
        </div>
        <img src="data:image/jpeg;base64,"></img>
      </div>
    </div>
  );
};

export default Home;
